  "title":"Le Gameplay ",
  "detail":"Il désigne <b>la prise en main du jeu</b> que l'on peut traduire en français par jouabilité. Ce terme est toutefois aussi associé à <b>l'ensemble des sensations ressenties par le joueur</b> lors de son expérience de jeu (plaisir, frustration,etc.)<br/> <br/> Exemples de différents gameplays : <br/> <ul> <li>Candy Crush</li></ul> <img src='http://candycrushsaga.com/img/screenshot.jpg'/> <ul> <li>Zelda</li></ul> <img src='http://cdn-static.gamekult.com/gamekult-com/images/photos/30/50/71/91/ME3050719179_2.jpg'/> <ul> <li>2048</li></ul> <img src='https://articles-images.sftcdn.net/wp-content/uploads/sites/9/2014/03/11.gif'/> <br/> <br/> Conseil : <b>jouer soi-même à différents types de jeux pour comprendre le ressenti</b><br/> <a href='http://eduscol.education.fr/jeu-numerique/#/article/1761' target='_blank'>Article 'Quel gameplay pour un serious game à destination des élèves ?'</a>",
