  "title":"Les joueurs",
  "detail":"Quant il s'agit de jeu, ne pas perdre de vue le fait que les <b>élèves sont des joueurs</b>. <br/> <br/> <ul> <li>Faire un sondage pour connaître les jeux auxquels jouent chacun</li><li>Définir le profil de joueur de vos élèves : <a href='http://4you2learn.com/bartle/' target='_blank'>Le test de Bartle</a></li><li>Différencier les jeux proposés aux élèves en fonction des résultats, dans la mesure du possible</li><li>Adapter le jeu à l'âge de l'élève dans le cas du serious gaming (vision 3D, déplacement dans l'espace, complexité du scénario...)</li><br/> </ul>",
