  "title":"La réalisation d'un serious game",
  "detail":"Récit d'expérience : c'est très difficile. <br/> 2 tentatives : <ul> <li>Inimaginable</li><li>Emile en ville</li><br/> </ul> Principaux problèmes rencontrés : <ul> <li><b>Trop de texte</b> pour faire passer des connaissances : les élèves ne lisent quasiment jamais les consignes dans un jeu.</li><li><b>Pas assez de feedbacks</b> : expliquer à l'élève ses erreurs</li><li><b>Problème d'outils</b> : développer from scratch demande énormément de temps, avec Xia, possible de faire une proposition mais ne permet pas de finaliser le jeu pour le moment.</li><li>C'est un métier : il faut maîtriser les bases du <b>game design</b> sur le bout des doigts.</li><br/> </ul> Pour créer un jeu, utiliser des <a href='https://creerunjeuvideo.fr/tous-les-logiciels-creer-un-jeu-video/' target='_blank'>logiciels adaptés</a>.<br/> ",
